        \   <li>\n            <a href=\"/computers/2020/02/11/github-google-container-cloud-run\">Using
        Github Actions to Build and Push Images to Google Container Registry</a>\n
        \           <span>(2020-02-11)</span>\n    </li>\n    </br> <em><p>\nEven
        personal projects that make use of Google Cloud Run to minimize\ncosts deserve
        CI.  And they can get it!\n</p>\n\n </em>\n    </div>\n  \n  <div class=\"post_info\">\n
        \   <li>\n            <a href=\"/2019/03/24/function-plotting-for-kids\">Plotting
