        \   </li>\n    </br> <em><p>\nTo plot functions on the computer, you need
        to install a program\ncalled <code>gnuplot</code>.  See the section below
        called <a href=\"#org653682b\">Installing gnuplot</a> for\nhow to do that.\n</p>\n\n
        </em>\n    </div>\n  \n  <div class=\"post_info\">\n    <li>\n            <a
