        Flask, Docker, Kubernetes, Microsoft Azure, and GoDaddy</a>\n            <span>(2019-02-11)</span>\n
        \   </li>\n    </br> <em><p>\nYou&rsquo;re talking with your wife one d<a
        href=\"https://www.letterkenny.tv/\">a</a>aayyy&#x2026; and realize that you\ncould
        improve her life by letting her create printable calendars and\nimportable
        ICS files for events she has to schedule.  And that should\nbe on the web,
        because while your wife is very smart, she is not very\ntechnical.\n</p>\n\n
        </em>\n    </div>\n  \n  <div class=\"post_info\">\n    <li>\n            <a
        href=\"/2016/06/24/dotplots-with-matplotlib\">Dotplots with Matplotlib</a>\n
        \           <span>(2016-06-24)</span>\n    </li>\n    </br> <em><p>\nI like
        the dotplots that R + ggplot2 can make.  There are lots of\nexamples of this
        on the Internet.  At least one is at <a href=\"http://www.r-bloggers.com/summarising-data-using-dot-plots/\">r-bloggers</a>,
