        using matplotlib.\n</p>\n\n </em>\n    </div>\n  \n  <div class=\"post_info\">\n
        \   <li>\n            <a href=\"/computer/python/datascience/2016/06/18/event-density\">Event
        Density Plot</a>\n            <span>(2016-06-18)</span>\n    </li>\n    </br>
        <em><p>\nI want to visualize how many concurrent events exist in a time period\nalong
        with how frequently they start and end.  I don&rsquo;t need to read\nnumbers
        off the visualization, I just want to get a relative sense of\nhow many events
        are starting, ongoing, and ending over a time period\nwith some resolution.
        \ Something that looks like this:\n</p>\n<div class=\"figure\">\n<p><object
